import React, { Component } from "react";

class NikeExport extends Component {
  state = { token: "" };
  render() {
    return (
      <form onSubmit={this.handleSubmit}>
        <label>Token</label>
        <input type="text" name="token" ref={(input = this.input = input)} />
      </form>
    );
  }
}

export default NikeExport;
